    [],nt"revision_timestamp": "2016-07-27T22:41:24.347886",nt"name": "intensive-level-cultural-resources-survey-baca-national-wildlife-refuge-headquarters-and-c",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Fish and Wildlife Service (USFWS)
    contracted with the Center of PreservationResearch (CoPR) at the University of Colorado
    to complete an intensive-level survey of twobuilding complexes at the Baca National
    Wildlife Refuge in Saguache County: the originalranch headquarters (where the refuge
    office is currently located) and the pure bred cattleheadquarters. The project was
    carried out under the Cooperative Ecosystems Studies UnitsNetwork. Located at the
    northern end of the San Luis Valley, near the town of Crestone, the BacaNational
    Wildlife Refuge was created in 2000. The refuge encompasses more than 92,500acres,
    incorporating most of the 100,000 acres of the Baca Grant No. 4. Commonly referred
    toas the Baca Ranch, the Baca Grant passed through a variety of owners, mostly corporations,before
    being acquired by the USFWS. No significant alterations have been made to the ranchcomplexes
    since the refuge was established, and most of the buildings are currently vacant.The
    goal of the project was to provide building evaluations to guide future site planning
    anddevelopment. The survey project included researching history and ranching context
    of theBaca Ranch and determining the National Register eligibility of the two building
    complexes.Throughout the remainder of the report these two building complexes will
    be referred to bytheir historic names: Home Ranch for the original ranch headquarters
    and Pure Bred Placefor the cattle headquarters.",nt"license_title": "License
